<h2> 一、是什么</h2>
<p>我们了解到，<code>Node</code>采用了事件驱动机制，而<code>EventEmitter</code>就是<code>Node</code>实现事件驱动的基础</p>`,r:{minutes:3.86,words:1159},y:"a",t:"说说 Node 中的 EventEmitter? 如何实现一个 EventEmitter?",i:"question",O:1,s:"前端物语|面试物语-说说 Node 中的 EventEmitter? 如何实现一个 EventEmitter?"},["/posts/interview/NodeJS/EventEmitter","/posts/interview/NodeJS/EventEmitter.md"]],["v-0a36747e","/posts/interview/NodeJS/",{a:"h7ml",d:1680912e6,l:"2023年4月8日",c:"NodeJS",g:"NodeJS",e:`<ul>
