<h2> 一、HEAD</h2>
<p>在<code>git</code>中，可以存在很多分支，其本质上是一个指向<code>commit</code>对象的可变指针，而<code>Head</code>是一个特别的指针，是一个指向你正在工作中的本地分支的指针</p>`,r:{minutes:2.79,words:837},y:"a",t:"说说 Git 中 HEAD、工作树和索引之间的区别？",i:"question",O:5,s:"前端物语|面试物语-说说 Git 中 HEAD、工作树和索引之间的区别？"},["/posts/interview/git/HEAD_tree_index","/posts/interview/git/HEAD_tree_index.md"]],["v-4e48f4a0","/posts/interview/git/",{a:"h7ml",d:16795296e5,l:"2023年3月23日",c:"git",g:"git",e:`<ul>
