<h2> 一、是什么</h2>
<p><code>Linux</code> 是一个开源的操作系统（OS），是一系列 Linux 内核基础上开发的操作系统的总称（常见的有 Ubuntu、centos）</p>`,r:{minutes:6.09,words:1826},y:"a",t:"说说 linux 系统下 文件操作常用的命令有哪些？",i:"question",O:2,s:"前端物语|面试物语-说说 linux系统下 文件操作常用的命令有哪些？"},["/posts/interview/linux/file","/posts/interview/linux/file.md"]],["v-35206a50","/posts/interview/linux/key.html",{a:"h7ml",d:1680048e6,l:"2023年3月29日",c:["interview","linux"],g:["interview","linux"],o:!1,e:`<hr>
